import React from 'react'
import { useParams } from 'react-router';
import Episodes from './Episodes';
import Rating from './Rating';

const AnimeDetails = () => {

    const { id } = useParams();


    return (
        <div>
            <Rating id={id}/>
            <Episodes id={id}/>
        </div>
    )
}

export default AnimeDetails;
